import './App.css';
import './Test.js';
import ReactDOM from 'react-dom';
import React from 'react';;

function Header(props) {
  return (
    <header className='col-sm-6'>
	  <h1>Main Heading Is Here {props.name}</h1>
    </header>
  );
}
class Product extends React.Component {
render() {
return (
<div className='item'>
<div className='image'>
    <img src='images/products/image-aqua.png' />
    </div>
    <div className='middle aligned content'>
    <div className='description'>
    <a>Fort Knight</a>
    <p>Authentic renaissance actors, delivered in just two week\
    s.</p>
    </div>
    <div className='extra'>
    <span>Submitted by:</span>
    <img
    className='ui avatar image'
    src='images/avatars/daniel.jpg'
    />
    </div>
    </div>
    </div>
);
}
}

function Main(props) {
  return (
    <section>
      <p>
        We serve the most {props.adjective} food around.
      </p>
      <ul style={{ textAlign: "left" }}>
        {props.dishes.map(dish => (
          <li key={dish.id}>{dish.title}</li>
        ))}
      </ul>
    </section>
  );
}


function Footer(props){
	return(
		<footer>
			<ul>
			 <li>Footer 1</li>
			<li>Footer 2</li>
			<li>Footer {props.year}</li>
			</ul>
		</footer>
	)
}

const dishes = [
	"Musa",
	"Tivo",
	"Kevin",
	"Steve"
];

const dishObjects = dishes.map((dish, i) => ({
  id: i,
  title: dish
}));

function Head(props) {
  return (
    <header>
	  <h1>Main Heading Is ? {props.name}</h1>
    </header>
  );
}

class Test extends React.Component{
  render() {
    return (
      <div className="Test">
  	  <Head name="Done Deal"/>
      </div>
    );
  }
}

class ProductList extends React.Component {
  render() {
    return (
    <div className='ui unstackable items'>
    Hello, friend! I am a basic React component.
    </div>
    );
  }
}

class App extends React.Component{
  render(){
  return (
    <div className="App">
	  <Header name="Tivo"/>
	  <Main dishes={dishObjects} />
	  <Footer year={new Date().getFullYear()}/>
    <Test />
    <ProductList />
    </div>
  );
  }
}



export default App;
